import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Form.css';


export default function FlightsInAir() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const load = () => {
    axios.get('/api/flights_in_air')
      .then(r => { setData(r.data); setError(null); })
      .catch(e => setError(e.message));
  };
  useEffect(() => { load() }, []);
  return (
    <div className="p-4">
      <h2 className="text-2xl font-semibold mb-4">Flights in the Air</h2>
      <button onClick={load} className="mb-4 px-4 py-2 bg-green-500 text-white rounded">Refresh</button>
      {error && <p className="text-red-600">Error: {error}</p>}
      <ul className="list-disc pl-5">
        {data.map((f,i) => <li key={i}>{JSON.stringify(f)}</li>)}
      </ul>
    </div>
  );
}
